}
.oo-ui-tabSelectWidget-framed {
   background-color: var(--bg-3); 
}
.mw-prefs-buttons {
   background-color: var(--bg-1); 
}
.oo-ui-tabOptionWidget {
    color: var(--co-1);
}
/*-*/

.fmbox {
    background-color: #458164 !important;
}
.mw-parser-output .ambox,
.fmbox-warning {
    background-color: #391717 !important;
